import '../styles/globals.css'
import { motion, AnimatePresence } from "framer-motion"

export default function main ({ Component, pageProps, router }) {
  return (
  	<AnimatePresence>
  		<motion.div initial="hidden" animate="visible" variants={{
  hidden: {
    opacity: 0
  },
  visible: {
    opacity: 1
  },
}}>
  			<Component {...pageProps} />
  		</motion.div>
  	</AnimatePresence>
  )
}
